class Suggestions extends Component {

     Suggestions = ({ ships }) => {
        return (
          <div>
            <center><h1>Ship List</h1></center>
            {ships.map((ship) => (
              <div class="card">
                <div class="card-body">
                  <h5 class="card-title">{ship.name}</h5>
                </div>
              </div>
            ))}
          </div>
        )
      };
    }
export default Suggestions
